package vn.edu.iuh.fit.entity;import java.io.Serializable;import java.util.Objects;import java.util.UUID;public class TourGuideAssignmentId implements Serializable {    private long departureId;    private long guideId;    public TourGuideAssignmentId() {}    public TourGuideAssignmentId(long departureId, long guideId) {        this.departureId = departureId;        this.guideId = guideId;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof TourGuideAssignmentId that)) return false;        return departureId == that.departureId && guideId == that.guideId;    }    @Override    public int hashCode() {        return Objects.hash(departureId, guideId);    }}